(function(){app.controller("LayoutCtrl",["$scope","$interval","$http",function(n,t,i){var r;n.appSettings=appSettings;n.appNotifications=[];r=function(){return i.get(n.appSettings.appNotification.url).success(function(t){return angular.forEach(t,function(t){return n.appNotifications.push(t)})})};n.appSettings.appNotification.url&&(r(),t(function(){return r()},n.appSettings.appNotification.interval*6e4));n.appMenus=[];n.appSettings.appMenu.url&&i.get(n.appSettings.appMenu.url).success(function(t){return n.appMenus=t});n.onNotificationClick=function(t){return n.appNotifications.splice(n.appNotifications.indexOf(t),1),dialog.alert(t.title)};n.logout=function(){return dialog.success("Logged out")}}])}).call(this);